reader = csv.DictReader(csvfile)
pre_1984 = 0
not_closed = 0 
closed_banks = {}
open_banks = {}
for row in reader: 
    #for banks that have opened 
    if row["RPT_START_YR"] == '':
        pre_1984 += 1 
    elif row["RPT_START_YR"] in open_banks:
        open_banks[row['RPT_START_YR']] = open_banks[row['RPT_START_YR']] + 1 
    else:
        open_banks[row['RPT_START_YR']] = 1

    #for banks that have closed 
    if row["RPT_STOP_YR"] == '':
        not_closed += 1 
    elif row["RPT_STOP_YR"] in closed_banks:
        closed_banks[row['RPT_STOP_YR']] = closed_banks[row['RPT_STOP_YR']] + 1 
    else:
        closed_banks[row['RPT_STOP_YR']] = 1

#output
#output should read a long list the year along with the number of banks closed or opened in the year 
print("Banks Pre 1984: ", pre_1984)
print("Banks Still Open: ", not_closed)
print("\nOpen Banks List:")
for x, y in open_banks.items():
    print(x,"\t", y)
print('\n')
print("Closed Banks List:")
for x, y in closed_banks.items():
    print(x,"\t", y)
